import React from 'react';
import { Card } from 'react-bootstrap';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

const ConversionFunnel = () => {
  const data = {
    labels: ['Lead', 'Qualified', 'Proposal', 'Negotiation', 'Won'],
    datasets: [
      {
        label: 'Conversion Rate',
        data: [100, 75, 50, 30, 20],
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1,
      },
    ],
  };

  return (
    <Card>
      <Card.Header>
        <h5>Conversion Funnel</h5>
      </Card.Header>
      <Card.Body>
        <Line data={data} />
      </Card.Body>
    </Card>
  );
};

export default ConversionFunnel;
